let baseURL = 'http://localhost:5000/data';

const GraphService =  {
 getGraph() {
      fetch(baseURL)
      .then(res => res.json())
      .then(data => console.log(data))
    //   .then(data => setPlotImage(data.image))
    }

}
export default GraphService;
